import React from "react";
import { Link } from "react-router-dom";
import './App.css';

function Navbar() {
  return (
    <nav className="navbar">
      <Link to="/">Home</Link>
      <Link to="/reset">Reset</Link>
      <Link to="/about">About</Link>
    </nav>
  );
}

export default Navbar;
